var SmallBoxes = 0;
/** @type {number} */
var SmallCount = 0;
/** @type {number} */
var SmallBoxesAnchos = 0;
(function($) {
  /**
   * @param {Object} params
   * @param {?} arg
   * @return {undefined}
   */
  $.smallBox = function(params, arg) {
    var banner;
    var content;
    params = $.extend({
      title : "",
      content : "",
      icon : undefined,
      iconSmall : undefined,
      sound : true,
      color : undefined,
      timeout : undefined,
      colortime : 1500,
      colors : undefined
    }, params);
    if (params.sound === true) {
      if (isIE8orlower() == 0) {
        /** @type {Element} */
        var sound = document.createElement("audio");
        if (navigator.userAgent.match("Firefox/")) {
          sound.setAttribute("src", $.sound_path + "smallbox.ogg");
        } else {
          sound.setAttribute("src", $.sound_path + "smallbox.mp3");
        }
        //$.get();
        sound.addEventListener("load", function() {
          sound.play();
        }, true);
        sound.pause();
        sound.play();
      }
    }
    SmallBoxes = SmallBoxes + 1;
    /** @type {string} */
    banner = "";
    /** @type {string} */
    var optsData = "";
    /** @type {string} */
    var val = "smallbox" + SmallBoxes;
    if (params.iconSmall == undefined) {
      /** @type {string} */
      optsData = "<div class='miniIcono'></div>";
    } else {
      /** @type {string} */
      optsData = "<div class='miniIcono'><i class='miniPic " + params.iconSmall + "'></i></div>";
    }
    if (params.icon == undefined) {
      /** @type {string} */
      banner = "<div id='smallbox" + SmallBoxes + "' class='SmallBox animated fadeInRight fast'><div class='textoFull'><span>" + params.title + "</span><p>" + params.content + "</p></div>" + optsData + "</div>";
    } else {
      /** @type {string} */
      banner = "<div id='smallbox" + SmallBoxes + "' class='SmallBox animated fadeInRight fast'><div class='foto'><i class='" + params.icon + "'></i></div><div class='textoFoto'><span>" + params.title + "</span><p>" + params.content + "</p></div>" + optsData + "</div>";
    }
    if (SmallBoxes == 1) {
      $("#divSmallBoxes").append(banner);
      SmallBoxesAnchos = $("#smallbox" + SmallBoxes).height() + 40;
    } else {
      var SmartExist = $(".SmallBox").size();
      if (SmartExist == 0) {
        $("#divSmallBoxes").append(banner);
        SmallBoxesAnchos = $("#smallbox" + SmallBoxes).height() + 40;
      } else {
        $("#divSmallBoxes").append(banner);
        $("#smallbox" + SmallBoxes).css("top", SmallBoxesAnchos);
        SmallBoxesAnchos = SmallBoxesAnchos + $("#smallbox" + SmallBoxes).height() + 20;
        $(".SmallBox").each(function(dataAndEvents) {
          if (dataAndEvents == 0) {
            $(this).css("top", 20);
            heightPrev = $(this).height() + 40;
            SmallBoxesAnchos = $(this).height() + 40;
          } else {
            $(this).css("top", heightPrev);
            heightPrev = heightPrev + $(this).height() + 20;
            SmallBoxesAnchos = SmallBoxesAnchos + $(this).height() + 20;
          }
        });
      }
    }
    var element = $("#smallbox" + SmallBoxes);
    if (params.color == undefined) {
      element.css("background-color", "#004d60");
    } else {
      element.css("background-color", params.color);
    }
    var scrollIntervalId;
    if (params.colors != undefined && params.colors.length > 0) {
      element.attr("colorcount", "0");
      /** @type {number} */
      scrollIntervalId = setInterval(function() {
        var i = element.attr("colorcount");
        element.animate({
          backgroundColor : params.colors[i].color
        });
        if (i < params.colors.length - 1) {
          element.attr("colorcount", i * 1 + 1);
        } else {
          element.attr("colorcount", 0);
        }
      }, params.colortime);
    }
    if (params.timeout != undefined) {
      setTimeout(function() {
        clearInterval(scrollIntervalId);
        var ThisHeight = $(this).height() + 20;
        /** @type {string} */
        var rval = val;
        var top = $("#" + val).css("top");
        if ($("#" + val + ":hover").length != 0) {
          $("#" + val).on("mouseleave", function() {
            /** @type {number} */
            SmallBoxesAnchos = SmallBoxesAnchos - ThisHeight;
            $("#" + val).remove();
            if (typeof arg == "function") {
              if (arg) {
                arg();
              }
            }
            /** @type {number} */
            var Primero = 1;
            /** @type {number} */
            var heightPrev = 0;
            $(".SmallBox").each(function(dataAndEvents) {
              if (dataAndEvents == 0) {
                $(this).animate({
                  top : 20
                }, 300);
                heightPrev = $(this).height() + 40;
                SmallBoxesAnchos = $(this).height() + 40;
              } else {
                $(this).animate({
                  top : heightPrev
                }, 350);
                heightPrev = heightPrev + $(this).height() + 20;
                SmallBoxesAnchos = SmallBoxesAnchos + $(this).height() + 20;
              }
            });
          });
        } else {
          clearInterval(scrollIntervalId);
          /** @type {number} */
          SmallBoxesAnchos = SmallBoxesAnchos - ThisHeight;
          if (typeof arg == "function") {
            if (arg) {
              arg();
            }
          }
          $("#" + val).removeClass().addClass("SmallBox").animate({
            opacity : 0
          }, 300, function() {
            $(this).remove();
            /** @type {number} */
            var Primero = 1;
            /** @type {number} */
            var pickWinTop = 0;
            $(".SmallBox").each(function(dataAndEvents) {
              if (dataAndEvents == 0) {
                $(this).animate({
                  top : 20
                }, 300);
                pickWinTop = $(this).height() + 40;
                SmallBoxesAnchos = $(this).height() + 40;
              } else {
                $(this).animate({
                  top : pickWinTop
                });
                pickWinTop = pickWinTop + $(this).height() + 20;
                SmallBoxesAnchos = SmallBoxesAnchos + $(this).height() + 20;
              }
            });
          });
        }
      }, params.timeout);
    }
    $("#smallbox" + SmallBoxes).bind("click", function() {
      clearInterval(scrollIntervalId);
      if (typeof arg == "function") {
        if (arg) {
          arg();
        }
      }
      var ThisHeight = $(this).height() + 20;
      var targetNode = $(this).attr("id");
      var top = $(this).css("top");
      /** @type {number} */
      SmallBoxesAnchos = SmallBoxesAnchos - ThisHeight;
      $(this).removeClass().addClass("SmallBox").animate({
        opacity : 0
      }, 300, function() {
        $(this).remove();
        /** @type {number} */
        var Primero = 1;
        /** @type {number} */
        var pickWinTop = 0;
        $(".SmallBox").each(function(dataAndEvents) {
          if (dataAndEvents == 0) {
            $(this).animate({
              top : 20
            }, 300);
            pickWinTop = $(this).height() + 40;
            SmallBoxesAnchos = $(this).height() + 40;
          } else {
            $(this).animate({
              top : pickWinTop
            }, 350);
            pickWinTop = pickWinTop + $(this).height() + 20;
            SmallBoxesAnchos = SmallBoxesAnchos + $(this).height() + 20;
          }
        });
      });
    });
  };
})(jQuery);
/**
 * @return {?}
 */
function getInternetExplorerVersion() {
  /** @type {number} */
  var rv = -1;
  if (navigator.appName == "Microsoft Internet Explorer") {
    /** @type {string} */
    var ua = navigator.userAgent;
    /** @type {RegExp} */
    var re = new RegExp("MSIE ([0-9]{1,}[.0-9]{0,})");
    if (re.exec(ua) != null) {
      /** @type {number} */
      rv = parseFloat(RegExp.$1);
    }
  }
  return rv;
}
/**
 * @return {undefined}
 */
function checkVersion() {
  /** @type {string} */
  var MSG_CLOSURE_CUSTOM_COLOR_INVALID_INPUT = "You're not using Windows Internet Explorer.";
  var ieVersion = getInternetExplorerVersion();
  if (ieVersion > -1) {
    if (ieVersion >= 8) {
      /** @type {string} */
      MSG_CLOSURE_CUSTOM_COLOR_INVALID_INPUT = "You're using a recent copy of Windows Internet Explorer.";
    } else {
      /** @type {string} */
      MSG_CLOSURE_CUSTOM_COLOR_INVALID_INPUT = "You should upgrade your copy of Windows Internet Explorer.";
    }
  }
  alert(MSG_CLOSURE_CUSTOM_COLOR_INVALID_INPUT);
}
/**
 * @return {?}
 */
function isIE8orlower() {
  /** @type {string} */
  var isIE8orlower = "0";
  var ieVersion = getInternetExplorerVersion();
  if (ieVersion > -1) {
    if (ieVersion >= 9) {
      /** @type {number} */
      isIE8orlower = 0;
    } else {
      /** @type {number} */
      isIE8orlower = 1;
    }
  }
  return isIE8orlower;
}
;